import Layout from '../components/layout/primaryLayout';
import { makeStyles } from '@material-ui/core/styles';
import { 
	Grid,
	FormControl,
	InputLabel,
	Select,
	MenuItem,
	OutlinedInput,
	FormHelperText,
	Switch
} from '@material-ui/core';

const useStyles = makeStyles(theme => ({
	root: {
	  display: 'flex',
	  flexWrap: 'wrap',
	},
	formControl: {
	  margin: theme.spacing(1),
	  minWidth: 120,
	},
	selectEmpty: {
	  marginTop: theme.spacing(2),
	},
}));

const Request = () => {
	const classes = useStyles();
  	const [values, setValues] = React.useState({
    	age: '',
    	name: 'hai',
  	});

  	const inputLabel = React.useRef(null);
  	const [labelWidth, setLabelWidth] = React.useState(0);
  	React.useEffect(() => {
    	setLabelWidth(inputLabel.current.offsetWidth);
  	}, []);

  	function handleChange(event) {
    	setValues(oldValues => ({
      		...oldValues,
      		[event.target.name]: event.target.value,
    	}));
  	}

	return (
		<Layout>
			<form className={classes.root} autoComplete="off">
				<Grid item xs={12} alignContent="center" justify="center">
					<FormControl fullWidth variant="outlined" className={classes.formControl}>
						<InputLabel ref={inputLabel} htmlFor="outlined-age-simple">
							Where
						</InputLabel>
						<Select
							value={values.age}
							onChange={handleChange}
							input={<OutlinedInput labelWidth={labelWidth} name="age" id="outlined-age-simple" />}
						>
							<MenuItem disabled value=""><em>Location</em></MenuItem>
							<MenuItem value={10}>Ten</MenuItem>
							<MenuItem value={20}>Twenty</MenuItem>
							<MenuItem value={30}>Thirty</MenuItem>
						</Select>
						<FormHelperText>Select Location</FormHelperText>
					</FormControl>
				</Grid>
				<Grid item xs={12} alignContent="center" justify="center">
					<FormControl fullWidth variant="outlined" className={classes.formControl}>
						<InputLabel ref={inputLabel} htmlFor="outlined-age-simple">
							What
						</InputLabel>
						<Select
							value={values.age}
							onChange={handleChange}
							input={<OutlinedInput labelWidth={labelWidth} name="age" id="outlined-age-simple" />}
						>
							<MenuItem disabled value=""><em>Issu</em></MenuItem>
							<MenuItem value={10}>Ten</MenuItem>
							<MenuItem value={20}>Twenty</MenuItem>
							<MenuItem value={30}>Thirty</MenuItem>
						</Select>
						<FormHelperText>Select Issue</FormHelperText>
					</FormControl>
				</Grid>
				<Grid item xs={12} alignContent="center" justify="center">
				<FormControlLabel
					value="top"
					control={<Switch color="primary" />}
					label="Top"
					labelPlacement="top"
				/>
				</Grid>
			</form>
		</Layout>
	)
}

export default Request
